import React, { Component } from "react";
import { Link } from 'react-router-dom';


class Product extends Component {
	render() {
		return (
			<div class="col-12 col-md-3 col-sm-6 my-3">
				<figure class="card card-product p-2 pb-3">
					<figcaption class="info-wrap pt-3">
						<Link to="/detailproduct" class="text-decoration-none">
							<div class="img-wrap" height="200px" width="300px">
								<img src={require('../../images/logo/logo.png')} />
							</div>
							<p class="title mt-2" style={{ fontWeight: 600 }}>
								namaProduk</p></Link>
						<div class='container'>
							<div class='row mx-auto'>
								<p >Rp 00000</p>
								<hr/>
								<p>nama penjual</p>
							</div>
							<hr/>
							<div class="mt-3 action-wrap">
								<a href="#" class="btn btn-info"><i class="fas fa-cart-plus"></i> Add to Cart </a>
							</div>
						</div>
					</figcaption>
				</figure>
			</div>
		);
	}
}

export default Product;
